import '../App.css'
import React, { useState, useEffect } from "react"
import Table from 'react-bootstrap/Table';


const CreateSession = () => {

  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(false);

  const createSesssionRequest = {
    method: 'POST',
    headers: { 'Content-Type': 'application/json' }
};

  useEffect(() => {
    setLoading(true);
    fetch("http://localhost:8080/restaurant/api/v1/createSession/ashutosh.bhardwaj@gmail.com", createSesssionRequest)
      .then((response) => response.json())
      .then((json) => setData(json))
      .finally(() => {
        setLoading(false);
      });
  }, []);

  try {
    axios
      .post("http://localhost:8080/restaurant/api/v1/createSession/ashutosh.bhardwaj@gmail.com")
      .then((res) => {
        console.log(res);
        console.log(res.data);
        //Adding user to local storage
          localStorage.setItem("sessionId", JSON.stringify(res.data.emailAddress));

      });
  } catch (error) {
    console.error("Error fetching data:", error);
    window.location = "/error"; //This line of code will redirect you once the submission is succeed
  }

  return (
    <Table striped bordered hover size="sm">
        <thead>
            <tr>
                <th>Session Id</th>
                 <th>Session Requested By</th>
                 <th>Status</th>
            </tr>
        </thead>

        <tbody>
            {
                 <tr key={data.sessionId}>
                 <td>{data.sessionId}</td>
                 <td>{data.sessionRequestedBy}</td>
                 <td>{data.message}</td>
               </tr>
            }
        </tbody>
    </Table>);
}
export default CreateSession;
